document.addEventListener('DOMContentLoaded', function() {
    var popup = document.getElementById('popup');
    var popupTitle = document.getElementById('popup-title');
    var popupData = document.getElementById('popup-data');
    var mapSvg = document.getElementById('mapSvg');
    
    document.querySelectorAll('.comune').forEach(function(el) {
        el.addEventListener('mouseenter', function(e) {
            var idx = parseInt(this.dataset.idx);
            var data = comuniData.find(function(d) { return d.idx === idx; });
            if (data) {
                popupTitle.textContent = data.comune + ' (' + data.provincia + ')';
                popupData.innerHTML = 'Voti Lega: ' + data.voti_lega.toLocaleString('it-IT') + '<br>Voti Zaia: ' + data.voti_zaia.toLocaleString('it-IT') + '<br>% Zaia: ' + data.pct_zaia.toLocaleString('it-IT', {minimumFractionDigits: 2, maximumFractionDigits: 2}) + '%';
                popup.style.display = 'block';
            }
        });
        
        el.addEventListener('mousemove', function(e) {
            popup.style.left = (e.pageX + 10) + 'px';
            popup.style.top = (e.pageY + 10) + 'px';
        });
        
        el.addEventListener('mouseleave', function() {
            popup.style.display = 'none';
        });
    });
    
    document.getElementById('provFilter').addEventListener('change', function(e) {
        var sel = e.target.value;
        
        if (sel === 'all') {
            mapSvg.setAttribute('viewBox', defaultViewBox);
        } else if (provViewBox[sel]) {
            mapSvg.setAttribute('viewBox', provViewBox[sel]);
        }
        
        document.querySelectorAll('.comune').forEach(function(el) {
            if (sel === 'all' || el.dataset.prov === sel) {
                el.classList.remove('hidden');
            } else {
                el.classList.add('hidden');
            }
        });
    });
});
